// Function to count the occurrences of a word in a file
int countWordOccurrences(const std::string& filename, const std::string& word) {
    int count = 0;
    std::ifstream file(filename);
    if (file.is_open()) {
        std::string line;
        while (std::getline(file, line)) {
            std::istringstream iss(line);
            std::string token;
            while (iss >> token) {
                if (token == word) {
                    count++;
                }
            }
        }
        file.close();
    } else {
        std::cerr << "Error: Unable to open file " << filename << std::endl;
    }
    return count;
}

int main() {
    std::string filename;
    std::string word;

    // Get the filename and word from the user
    std::cout << "Enter the filename: ";
    std::cin >> filename;
    std::cout << "Enter the word to count: ";
    std::cin >> word;

    // Count the occurrences of the word in the file
    int occurrences = countWordOccurrences(filename, word);

    // Display the result
